import React from 'react';          // Import React
import ReactDOM from 'react-dom';    // Import ReactDOM to render your components
import './index.css';               // Import global styles for your app
import FlowtimeTimer from './FlowtimeTimer'; // Import the FlowtimeTimer component
import reportWebVitals from './reportWebVitals'; // Optional for performance tracking

// ReactDOM.render renders the FlowtimeTimer inside the root div of index.html
ReactDOM.render(
  <React.StrictMode>
    <FlowtimeTimer />  {/* Rendering the FlowtimeTimer component */}
  </React.StrictMode>,
  document.getElementById('root')  // This matches the div with id="root" in index.html
);

// Optional: Use reportWebVitals for measuring app performance
reportWebVitals();
